prediction.sparql:
PREFIX imdb_principal: <https://www.imdb.com/principal/>
PREFIX imdb: <https://www.imdb.com/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?movie ?movieLabel ?actor ?actorLabel ?birthYear ?releaseYear ( ( ?releaseYear - ?birthYear ) AS ?ageAtRelease ) WHERE {
  ?movie imdb:numVotes ?numVotes .
  FILTER ( ?numVotes >= 100000 ) .
  ?movie imdb:startYear ?releaseYear .
  {
    ?movie imdb_principal:actor ?actor .
  } UNION {
    ?movie imdb_principal:actress ?actor .
  }
  ?actor imdb:birthYear ?birthYear .
  OPTIONAL {
    ?movie rdfs:label ?movieLabel
  }
  .
  OPTIONAL {
    ?actor rdfs:label ?actorLabel
  }
  .
}
ORDER BY DESC ( ?ageAtRelease )
LIMIT 10

PREFIX imdb: <https://www.imdb.com/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?actor ?actorLabel WHERE {
  ?actor imdb:knownForTitle ?movie .
  ?movie imdb:isAdult ?isAdult .
  OPTIONAL {
    ?movie imdb:numVotes ?numVotes .
  }
  FILTER ( ( ?isAdult = true ) || ( ?isAdult = false && ?numVotes >= 100000 ) ) OPTIONAL {
    ?actor rdfs:label ?actorLabel
  }
}
GROUP BY ?actor ?actorLabel
HAVING ( SUM( IF( ?isAdult = true , 1 , 0 ) ) >= 3 && SUM( IF( ?isAdult = false && ?numVotes >= 100000 , 1 , 0 ) ) >= 1 )

PREFIX imdb: <https://www.imdb.com/>
SELECT ?decade ( AVG( ?rating ) AS ?avgRating ) WHERE {
  {
    SELECT ?movie ( FLOOR( ?year / 10 ) * 10 AS ?decade ) ?rating WHERE {
      ?movie imdb:genre "Sci-Fi" .
      ?movie imdb:titleType "movie" .
      ?movie imdb:numVotes ?numVotes .
      FILTER ( ?numVotes > 10000 ) .
      ?movie imdb:averageRating ?rating .
      ?movie imdb:startYear ?year .
    }
  }
}
GROUP BY ?decade
ORDER BY ?decade

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?director ?directorName ?birthYear ?movie ?movieName ?numVotes WHERE {
  ?movie imdb:numVotes ?numVotes .
  FILTER ( ?numVotes > 1000000 ) .
  ?movie imdb:director ?director .
  ?director imdb:birthYear ?birthYear .
  OPTIONAL {
    ?director rdfs:label ?directorName
  }
  .
  OPTIONAL {
    ?movie rdfs:label ?movieName
  }
  .
}
ORDER BY DESC ( ?birthYear )
LIMIT 1
